import React, { useEffect, useState } from 'react';
import axios from 'axios';
const ProductList = () => {
    const [products,setProduct] = useState([]);
    useEffect(async ()=>{
        try {
            const res = await axios.get('https://fakestoreapi.com/products');
            setProduct(res.data);
        } catch (error) {
            console.log(error);
        }
    },[])
  return (
    <div>ProductList</div>
  )
}

export default ProductList
